import axios from 'axios';
export const fetchSegmentationResults = async () => {
    const response = await fetch('/path/to/segmentation_results.json');
    const data = await response.json();
    return data;
  };
  
  export const fetchPerformanceResults = async () => {
    try {
      const response = await axios.get('/twitter-predictions'); // Adjust URL to your Flask API endpoint
      return response.data;
    } catch (error) {
      console.error('Error fetching performance results:', error);
      return { actual: [], predicted: [] }; // Return empty data or handle error as needed
    }
  };

export const fetchChurnResults = async () => {
  try {
    const response = await axios.get('/spotify-predictions'); // Adjust URL to your Flask API endpoint
    return response.data;
  } catch (error) {
    console.error('Error fetching churn results:', error);
    return { actual: [], predicted: [] }; // Return empty data or handle error as needed
  }
};
